import React, { Component } from "react";
import Mail from "./images/mail-40x40px-72dpi.png";
import Insta from "./images/insta-40x40px-72dpi.png";
import Face from "./images/fb-40x40px-72dpi.png";
import "../App.css";

export class Footer extends Component {
  render() {
    return (
      <div className="footer">
        <div className="redline"></div>
        <div className="social">
          <a href="mailto:mail@gilanis.de">
            <img class="footicon" src={Mail} alt="E-Mail" alt="E-Mail" />
          </a>
          <a
            href="https://www.instagram.com/tayo_no_hikari/?hl=de"
            target="_blank"
          >
            <img class="footicon" src={Insta} alt="Instergram" />
          </a>
          <a
            href="https://www.instagram.com/tayo_no_hikari/?hl=de"
            target="_blank"
          >
            <img class="footicon" src={Face} alt="Facebook" />
          </a>
        </div>
        <div className="footlink">
          <p className="linkeins">Impressum</p>
          <p className="linkeins">Datenschutz</p>
        </div>
      </div>
    );
  }
}

export default Footer;
